import React from "react";
import {
  Toolbar,
  AppBar,
  TextField,
  InputAdornment,
  IconButton,
} from "@material-ui/core";
import SearchIcon from "@material-ui/icons/SearchOutlined";
import { makeStyles } from "@material-ui/styles";
import SearchData from "../../functions/SearchData/SearchData";

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: theme.palette.type === "dark" ? "#1e1e1e" : "#ffffff",
    opacity: 0.85,
  },
}));

function AppBarChild() {
  const classes = useStyles();
  const [arrayMovieA2021, setArrayMovieA2021] = React.useState([]);
  const [titleMovie, setTitleMovie] = React.useState("");

  React.useEffect(() => {
    (async () => setArrayMovieA2021(await SearchData()))();
  }, []);

  console.log(titleMovie);
  return (
    <AppBar position="fixed" className={classes.appBar}>
      <Toolbar disableGutters variant="regular">
        <TextField
          label="Digite o Nome do Filme"
          onChange={(event) => setTitleMovie(event.target.value)}
          InputProps={{
            endAdornment: (
              <InputAdornment>
                <IconButton>
                  <SearchIcon />
                </IconButton>
              </InputAdornment>
            ),
          }}
          fullWidth
        />
      </Toolbar>
    </AppBar>
  );
}

export default AppBarChild;
